import React from 'react';


const PlaylistSelector = (props) => <button className={`butPlayListOff ${props.on && props.playList===props.playListActive?'plListActive': props.on && props.playList!==props.playListActive? 'plListDisabled':''}`} onClick={props.changePlaylist}>{props.playList}</button>

export default PlaylistSelector;
